  <source srcset="img_avatar.png" />
  <source srcset="img_girl.jpg" />
  <img src="img_beatles.gif" alt="Beatles" style="width:auto;" />
</picture>
    <BannerTextBackground>
      <BannerText>HYBRID MIXING & MASTERING SOLUTIONS | Beats By DJ Definition & Other Producers | Artist Promotions</BannerText>
    </BannerTextBackground>
  </BannerContainer>

);

